    //rating avreage - calculation
    let average = feedback.reduce ((acc, cur) => {
        return acc + cur.rating
    }, 0) / feedback.length

  return (
    <div className="feedback-stats">
        <h4>{feedback.length} Reviews:</h4>
        <h4>Avreage Rating: 10</h4>
    </div>
  )
}

